import Loading from '../components/Loading';

export default function Home() {
  return (
    <div className="max-w-4xl mx-auto p-10 bg-black/30 backdrop-blur-lg rounded-3xl shadow-lg border border-gray-700 text-center space-y-6">
      <h2 className="text-5xl font-semibold text-cyan-500 tracking-wide">Welcome to TrendAI</h2>
      <p className="text-gray-300 text-lg leading-relaxed max-w-3xl mx-auto">
        Your ultimate high-tech crypto and AI content generator platform with elegant design and smooth user experience.
      </p>
      <Loading />
    </div>
  );
}
